{
  "$schema": "http://json-schema.org/draft-04/schema#",
  "type": "object",
  "title": "Cloud Pub/Sub Message",
  "description": "Message received by Cloud Pub/Sub.",
  "properties": {
    "data": {
      "type": "string",
      "description": "The message data sent by the publisher"
    },
    "attributes": {
      "type": "object",
      "description": "Attributes for this message"
    },
    "messageId": {
      "type": "string",
      "description": "ID of this message, assigned by the server when the message is published. Guaranteed to be unique within the topic."
    },
    "publishTime": {
      "type": "string",
      "description": "The time at which the message was published, populated by the server when it receives the topics.publish call"
    },
    "orderingKey": {
      "type": "string",
      "description": "Identifies related messages for which publish order should be respected."
    }
  }
}

{
  "type": "array",
  "items": {
    "type": "object",
    "properties": {
      "Id": {
        "type": "string",
        "readOnly": false,
        "description": "The ID of the object, including the bucket name, object name, and generation number."
      },
      "Name": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The name of the object. Required if not specified by URL parameter."
      },
      "Bucket": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The name of the bucket containing this object."
      },
      "Generation": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The content generation of this object. Used for object versioning."
      },
      "MetaGeneration": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The version of the metadata for this object at this generation. Used for preconditions and for detecting changes in metadata. A metageneration number is only meaningful in the context of a particular generation of a particular object."
      },
      "ContentType": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Content-Type of the object data. If an object is stored without a Content-Type, it is served as application/octet-stream."
      },
      "TimeCreated": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The creation time of the object in RFC 3339 format."
      },
      "Updated": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The modification time of the object metadata in RFC 3339 format."
      },
      "TimeDeleted": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The deletion time of the object in RFC 3339 format. Returned if and only if this version of the object is no longer a live version, but remains in the bucket as a noncurrent version."
      },
      "TemporaryHold": {
        "type": ["boolean", "null"],
        "readOnly": false,
        "description": "Whether or not the object is subject to a temporary hold."
      },
      "EventBasedHold": {
        "type": ["boolean", "null"],
        "readOnly": false,
        "description": "Whether or not the object is subject to an event-based hold."
      },
      "RetentionExpirationTime": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The earliest time that the object can be deleted, based on a bucket\u0027s retention policy, in RFC 3339 format."
      },
      "StorageClass": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Storage class of the object."
      },
      "TimeStorageClassUpdated": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The time at which the object\u0027s storage class was last changed. When the object is initially created, it will be set to timeCreated."
      },
      "Size": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Content-Length of the data in bytes."
      },
      "Md5Hash": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "MD5 hash of the data; encoded using base64. For more information about using the MD5 hash, see Hashes and ETags: Best Practices."
      },
      "MediaLink": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Media download link."
      },
      "ContentEncoding": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Content-Encoding of the object data."
      },
      "ContentDisposition": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Content-Disposition of the object data."
      },
      "ContentLanguage": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Content-Language of the object data."
      },
      "CacheControl": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Cache-Control directive for the object data. If omitted, and the object is accessible to all anonymous users, the default will be public, max-age\u003d3600."
      },
      "OwnerEntity": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The entity, in the form user-emailAddress."
      },
      "OwnerEntityId": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The ID for the entity."
      },
      "Crc32c": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "CRC32c checksum, as described in RFC 4960, Appendix B; encoded using base64 in big-endian byte order. For more information about using the CRC32c checksum, see Hashes and ETags: Best Practices."
      },
      "ComponentCount": {
        "type": ["number", "null"],
        "readOnly": false,
        "description": "Number of underlying components that make up a composite object. Components are accumulated by compose operations, counting 1 for each non-composite source object and componentCount for each composite source object. Note: componentCount is included in the metadata for composite objects only."
      },
      "Etag": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "HTTP 1.1 Entity tag for the object."
      },
      "CustomerEncryptionAlgorithm": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "The encryption algorithm."
      },
      "CustomerEncryptionKeySha256": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "SHA256 hash value of the encryption key."
      },
      "KmsKeyName": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "Cloud KMS Key used to encrypt this object, if the object is encrypted by such a key."
      },
      "CustomTime": {
        "type": ["string", "null"],
        "readOnly": false,
        "description": "CA user-specified timestamp for the object in RFC 3339 format."
      }
    }
  }
}

{
  "type": "object",
  "properties": {
    "Bucket": {
      "type": "string",
      "readOnly": false,
      "description": "Bucket name where the object is located."
    },
    "ObjectFilePath": {
      "type": ["string", "null"],
      "readOnly": false,
      "description": "Object name for the object that should be retrieved. If not specified, all the objects from the specified bucket will be retrieved."
    },
    "FolderPath": {
      "type": ["string", "null"],
      "readOnly": false,
      "description": "The path, or URI, to the file that will receive the data of the object."
    },
    "HasBytes": {
      "type": ["boolean", "null"],
      "readOnly": false,
      "description": "Whether to download content as bytes.",
      "default": false
    },
    "UpdatedEndDate": {
      "type": ["string", "null"],
      "readOnly": false,
      "description": "The end of the date range to download objects. If not specified, objects will be downloaded from the specified UpdatedStartDate until the present day."
    },
    "UpdatedStartDate": {
      "type": ["string", "null"],
      "readOnly": false,
      "description": "The start of the date range to download objects. If not specified, objects will be downloaded from the beginning of the time until the UpdatedEndDate."
    },
    "Encoding": {
      "type": ["string", "null"],
      "readOnly": false,
      "description": "If the LocalFile input is left empty, the data will be output to FileData in the specified encoding.The allowed values are NONE, BASE64.",
      "default": "BASE64"
    }
  }
}

